Here's the main code of the project, which you should put in the kybra_hello_world/src/main.py file of your canister: from kybra import query, update, void # This is a global variable that is stored on the heap
message: str = '' # Query calls complete quickly because they do not go through consensus
@query
def get_message() -> str: return message # Update calls take a few seconds to complete
# This is because they persist state changes and go through consensus
@update
def set_message(new_message: str) -> void: global message message = new_message # This change will be persisted Let's discuss each section of the code. from kybra import query, update, void The code starts off by importing the query and update decorators from kybra, along with the void type. The kybra module provides most of the Internet Computer (IC) APIs for your canister. # This is a global variable that is stored on the heap
message: str = '' We have created a global variable to store the state of our application. This variable is in scope to all of the functions defined in this module. We have annotated it with a type and set it equal to an empty string. # Query calls complete quickly because they do not go through consensus
@query
def get_message() -> str: return message We are exposing a canister query method here. When query methods are called they execute quickly because they do not have to go through consensus. This method simply returns our global message variable. # Update calls take a few seconds to complete
# This is because they persist state changes and go through consensus
@update
def set_message(new_message: str) -> void: global message message = new_message # This change will be persisted We are exposing an update method here. When update methods are called they take a few seconds to complete. This is because they persist changes and go through consensus. A majority of nodes in a subnet must agree on all state changes introduced in calls to update methods. This method accepts a string from the caller and will store it in our global message variable. That's it! We've created a very simple getter/setter Hello World application. But no Hello World project is complete without actually yelling Hello world! To do that, we'll need to setup the rest of our project.
